{
  "application": "IOR",
  "details": {
    "software": [
      "IOR 4.0.0rc1",
      "MPI (mpiexec)"
    ],
    "resources": {
      "PBS": {
        "account": "CSC250STDM12",
        "walltime": "20:00",
        "filesystems": "home, grand",
        "nodes": 8,
        "placement": "scatter",
        "environment": "export all variables to this script"
      },
      "modules": {
        "default": "PrgEnv-gnu",
        "optional": "PrgEnv-intel"
      },
      "storage": {
        "output_path": "/grand/radix-io/scratch/$USER/ior",
        "striping_factor": 1
      },
      "IOR_options": {
        "MPI_IO": true,
        "fsync": true,
        "reorder_ranks": true,
        "segments": 8,
        "iterations": 5,
        "transfer_size": "1MiB",
        "block_size": "64MiB",
        "output_file": "ior-fpp-nostripe.out"
      },
      "MPI_options": {
        "ranks_per_node": 4,
        "depth": 1,
        "cpu_binding": "depth"
      }
    }
  }
}
